import React from 'react';
import Button from 'react-bootstrap/Button';
import { Form } from 'react-bootstrap';
const Users = () => {
    return (
        <div>
            <div className="container">
                <h3>Login</h3>
                <Form.Control size="lg" type="text" placeholder="Username" style={{ width: 500 }} />
                <br />
                <Form.Control size="lg" type="md5" placeholder="Password" style={{ width: 500 }} /> <br />
                <Button variant="info">Connecter</Button>
            </div>
        </div>
    );
};

export default Users;
